import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/BlogPage.css';

function BlogPage() {
  const [title, setTitle] = useState('');
  const [code, setCode] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate('/submitted-codes');
  };

  return (
    <div className="container">
      <div className="code-background">
        <div className="code-animation">const exampleCode = "This is an example of floating code";</div>
        <div className="code-animation">console.log("Another line of code moving around");</div>
      </div>
      <div className="title-container">
        <h1>Submit<br />Your<br /><span>Code</span></h1>
      </div>
      <div className="form-container">
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            placeholder="Title"
          />
          <textarea
            value={code}
            onChange={(e) => setCode(e.target.value)}
            placeholder="Code"
          />
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
}

export default BlogPage;
